import React from "react";
import PaintCard from "./PaintCard";
import Expert from "./Expert";
import Slider from "./Slider";


const Home = () => {

return(
    <>
      <Slider />

      
      <section className="body_part">     
       <PaintCard/>
      <Expert/>
      </section>

      
    </>
);
};
export default Home;
